import { useSelector } from "react-redux"

const Header = () => {

    const user = useSelector(state => state.user)

    return (
        <>
            { user.name ? <h1 style={{borderBottom: '1px solid black', marginBottom: '10px'}}>Hello {user.name}</h1> : <h1 style={{borderBottom: '1px solid black'}}>Hello Guest</h1>}
        </>
    )
}

export default Header
